func GetDatabaseName() (string, error) {
	database := os.Getenv("MONGODB_DATABASE")

	if database == "" {
		return "", errors.New("missing required MongoDB database environment variable")
	}

	return database, nil
}

def mongodb_database(self) -> str:
        """MongoDB database name (default: 'stride_sync')."""
        return self._mongodb_database
